// data set containing estimates at each precision level and their associated
// bias values. While the estimate values *tend* to be in increasing order,
// they did not increase monotonically which would break naive interpolation
// algorithms. The authors circumvented this by using kNearestNeighbor, but
// this library opts for a more straightforward linear interpolation method.
//
// As such, the data here *is* sorted so that estimate values increase
// monotonically with their associated array indices.

